import React from 'react'
import { useState } from 'react';
import logo from './Images/notes.jpg'

const Header = () => {
   
    let [time , setTime] = useState(currTime);
    
   
  return (
    <>
     <div className="header">
     <h1>Keep here</h1>
         <img src={logo} alt="logo" width='50px' height='50' />
         <h1>{time}</h1>
     </div>
    </>
  );
};
export default Header;
